import styled from 'styled-components'

export const Carmini = styled.section`
    display: flex;
    flex-direction: column;
    border: 1px solid black;
    height: 100px;
    width: 450px;
    `

export const CarminiImg = styled.section`
    display: inline;
    width: 20px;
    margin-left: 0px;
    border-radius: 50%;
`

export const CarminiP = styled.section`
    display: inline;
`
